import { useState } from "react";
import UserForm from "./UserForm";

function App() {
  const [ users, setUsers ] = useState([])

  const onUserAdd = (user) => {
    setUsers([...users, user])
  }

  return (
   <div>
    <UserForm/>
   </div>
  );
}

export default App;
